import React from "react";

const Enter = () => {
    return (
        <div className="initial_enter">
            <div className="main">
                <input type="checkbox" id="chk" aria-hidden="true" />

                <div className="signup">
                    <form>
                        <label for= "chk" aria-hidden="true"></label>
                    </form>
                </div>


            </div>
        </div>
    )
}
export default Enter;
